import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="{pineapple.png}" className="App-logo" alt="logo" />
        <p>
          Cultured.
        </p>
      </header>
    </div>
  );
}

export default App;
